import HeaderLinks from "../PrivateLandingPage";
import * as React from "react";
import Header from "../../components/Header/Header";

export default  function CreateMnemonicPage(props){
    const { ...rest } = props;
    return (
        <div>
            <Header
                color="transparent"
                brand="Private.Storage"
                rightLinks={<HeaderLinks/>}
                fixed
                changeColorOnScroll={{
                    height: 400,
                    color: "white",
                }}
                {...rest}
            />
        </div>
    );
}
